import axios from "axios";

export const getWeatherList = async () => {
    const weather = await axios.get(
        `https://ibnux.github.io/BMKG-importer/cuaca/wilayah.json`
    );

    return weather.data.data;
};

export const getDetailWeather = async () => {
    const weather = await axios.get(
        `https://ibnux.github.io/BMKG-importer/cuaca/501193.json`
    );
    return weather.data.data;
};

export const getCharacterList = async () => {
    const url = "https://api-blue-archive.vercel.app/api/characters"

      try {
        const character = await axios.get(url);
        return character.data.data;
      } catch (error) {
        console.error('Error fetching character list:', error);
      }
    };
